import "./Navbar.css";
import { Link } from "react-router-dom";
import { useContext } from "react";
import { AuthContext } from "../../context/AuthContext";

const Navbar = () => {
  const { user } = useContext(AuthContext);

  return (
    <div className="navbar">
      <div className="navContainer">
        <Link to="/" style={{ color: "inherit", textDecoration: "none" }}>
          <span className="logo">Elaco Coworking Space</span>
        </Link>
        
        {user ? (
          <div className="userInfo">
            <div className="items">
            <div className="item">
            <img
              src="https://scontent.ftun1-2.fna.fbcdn.net/v/t39.30808-6/275306017_697267211456768_4307767331166662519_n.jpg?_nc_cat=100&ccb=1-7&_nc_sid=5f2048&_nc_ohc=Tl97unCK0ygAb6sk1es&_nc_ht=scontent.ftun1-2.fna&oh=00_AfD5GRI9_x-tLy84DhJtF07HvLFUeRxboKqhxeZECBaCBw&oe=6628AEFC"
              alt=""
              className="avatar"
            />
          </div>
          {user.img}

            <span className="username">{user.username}</span>
      
            
          </div>
           </div>

          
        ) : (
          <div className="navItems">
            <Link to="/register" style={{ color: "inherit", textDecoration: "none" }}>
              <button className="navButton">Register</button>
            </Link>
            <Link to="/login" style={{ color: "inherit", textDecoration: "none" }}>
              <button className="navButton">Login</button>
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
